anguageName\":{\"simpleText\":\"Telugu\"}},{\"languageCode\":\"th\",\"languageName\":{\"simpleText\":\"Thai\"}},{\"languageCode\":\"tr\",\"languageName\":{\"simpleText\":\"Turkish\"}},{\"languageCode\":\"tk\",\"languageName\":{\"simpleText\":\"Turkmen\"}},{\"languageCode\":\"uk\",\"languageName\":{\"simpleText\":\"Ukrainian\"}},{\"languageCode\":\"ur\",\"languageName\":{\"simpleText\":\"Urdu\"}},{\"languageCode\":\"ug\",\"languageName\":{\"simpleText\":\"Uyghur\"}},{\"languageCode\":\"uz\",\"languageName\":{\"simpleText\":\"Uzbek\"}},{\"languageCode\":\"vi\",\"languageName\":{\"simpleText\":\"Vietnamese\"}},{\"languageCode\":\"cy\",\"languageName\":{\"simpleText\":\"Welsh\"}},{\"languageCode\":\"fy\",\"languageName\":{\"simpleText\":\"Western Frisian\"}},{\"languageCode\":\"xh\",\"languageName\":{\"simpleText\":\"Xhosa\"}},{\"languageCode\":\"yi\",\"languageName\":{\"simpleText\":\"Yiddish\"}},{\"languageCode\":\"yo\",\"languageName\":{\"simpleText\":\"Yoruba\"}},{\"languageCode\":\"zu\",\"languageName\":{\"simpleText\":\"Zulu\"}}],\"defaultAudioTrackIndex\":0,\"contribute\":{\"captionsMetadataRenderer\":{\"addSubtitlesText\":{\"runs\":[{\"text\":\"Add subtitles\/CC\",\"navigationEndpoint\":{\"clickTrackingParams\":\"CAAQu2kiEwivnMbc45jqAhXCFBYKHWVDB1w=\",\"commandMetadata\":{\"webCommandMetadata\":{\"url\":\"\/timedtext_video?ref=watch\\u0026v=W3-mh0rwrmw\",\"rootVe\":83769}},\"urlEndpoint\":{\"url\":\"\/timedtext_video?ref=watch\\u0026v=W3-mh0rwrmw\"}}}]},\"noSubtitlesText\":{\"simpleText\":\"This video doesn't have subtitles or closed captions yet.\"},\"promoSubtitlesText\":{\"simpleText\":\"Help this video reach more people by contributing subtitles or closed captions in a language you speak.\"}}}}},\"videoDetails\":{\"videoId\":\"W3-mh0rwrmw\",\"title\":\"Where Delos was BORN!!! We invade the AMEL YACHT shipyard!!  Sailing Vessel Delos- Ep. 140\",\"lengthSeconds\":\"2003\",\"keywords\":[\"sailing\",\"sailing (sport)\",\"sailing around the world\",\"إبحار\",\"cruising\",\"yacht\",\"sailboat\",\"sailboat (ship type)\",\"sailor\",\"life on a yacht\",\"Travel Documentary\",\"Travel\",\"Adventure Documentary\",\"adventure\",\"Rough Seas\",\"circumnavigate\",\"ketch\",\"sail\",\"boat\",\"blue water cruising\",\"sailing for beginners\",\"single-handed sailing (film subject)\",\"storm\",\"islands\",\"marine\",\"fishing\",\"sv delos\",\"Amel Super Maramu\",\"Seven Seas\",\"diving\",\"remote diving\",\"underwater photography\",\"delos\",\"ocean\",\"navegación\",\"amel\",\"super maramu\",\"la rochelle\"],\"channelId\":\"UCvLc83k5o11EIF1lEo0VmuQ\",\"isOwnerViewing\":false,\"shortDescription\":\"The Delos Crew invades the birthplace of Delos- the Amel shipyard in La Rochelle, France!!!  It’s always been a dream of ours to meet the team of people that designed and crafted Delos!  After years of sailing the wild oceans we find ourselves in Cape Town safely at a dock and the awesome team at Amel invite us to France to see where Delos was born.  We learn about the history of “The Captain” (Mr. Amel), tour the factory, gorge ourselves on French cuisine, sail on a NEW AMEL 55, and Capt. Breeyawn shows the Amel team how we guzzle champagne Delos style!  How cool is that?!?!?  Thanks so much for the invite guys, we had an absolute blast :)  Sending much love to you from Delos on the high seas.\\n\\nSubscribe at http:\/\/youtube.com\/svdelos\\nThis is our story, a story of three souls sailing around the world.  It is a story about sailing and travel and adventure.  But it's also a story about meeting amazing people and making life long friends.  It's a story of people living their lives in an alternate way, in close connection with the beautiful people and amazing planet that we call home.  Our experience has affected us so profoundly we want to share it, hoping that others may find inspiration to follow their dreams and do what they love.\\nFor more sailing around the World Action! Join the SV Delos Tribe! \\nhttp:\/\/svdelos.com\/camera - Camera gear!\\nhttp:\/\/patreon.com\/svdelos - Support us on Patreon for unseen footage.\\nhttp:\/\/svdelos.com - Subscribe to our new awesome website\\nhttp:\/\/instagram.com\/svdelos - Follow us on Instagram for more behind the scenes footage\\nhttp:\/\/facebook.com\/svdelos - Like us on Facebook \\nhttp:\/\/svdelos.com\/beer - If you like what you see send us a cold one ;)\\nhttp:\/\/svdelos.com\/gear\/ - Support us buy a sweet Delos T-shirt!\\n\\nSend Us Love\\nWe LOVE sailing, we LOVE traveling, and we LOVE making videos about it!  We're only half-way around the world, so there's plenty more to see! Your support will fund better camera gear, internet to upload videos, and of course creative lubricants to smooth the editing process :) \\n\\nSupport Our Videos- Buy us a cold one.\\nhttp:\/\/svdelos.com\/beer\\n\\nThis is made possible by YOU! So thank you so much for all the love and support you guys are sending us! It means a lot! Much Love, Karin, Brian and Brady\\n\\nTunes used in this vid\\n19:00 Ramukanji by Onetox (https:\/\/soundcloud.com\/sailing-sv-delos\/onetox-ramukanji-2011-official-remix)\\n02:20 Thingamajig by Audionautix (http:\/\/audionautix.com)\\n03:31 Live Recordings by Kiko (https:\/\/soundcloud.com\/sailing-sv-delos\/sets\/covers-by-kiko)\\n06:24 This time by GYVUS (http:\/\/chillhop.com\/listen) (https:\/\/soundcloud.com\/gyvus)\\n15:00 SoulGroove by Audionautix (http:\/\/audionautix.com)\\n17:06 Happy Hours by L'IndÇcis (http:\/\/chillhop.com\/listen)\\n22:40 Live Recordings by Kiko (https:\/\/soundcloud.com\/sailing-sv-delos\/sets\/covers-by-kiko)\\n24:55 Eunoia by Andrew Rothschild (https:\/\/andrewrothschild.bandcamp.com\/)\\n26:42 Tōzen by GYVUS (http:\/\/chillhop.com\/listen) (https:\/\/soundcloud.com\/gyvus)\\n30:52 How About It by Topher Mohr and Alex Elena (Youtube Audio Library)\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/W3-mh0rwrmw\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAA e=1\"},\"title\":{\"simpleText\":\"Where Delos was BORN!!! We invade the AMEL YACHT shipyard!!  Sailing Vessel Delos- Ep. 140\"},\"description\":{\"simpleText\":\"The Delos Crew invades the birthplace of Delos- the Amel shipyard in La Rochelle, France!!!  It’s always been a dream of ours to meet the team of people that designed and crafted Delos!  After years of sailing the wild oceans we find ourselves in Cape Town safely at a dock and the awesome team at Amel invite us to France to see where Delos was born.  We learn about the history of “The Captain” (Mr. Amel), tour the factory, gorge ourselves on French cuisine, sail on a NEW AMEL 55, and Capt. Breeyawn shows the Amel team how we guzzle champagne Delos style!  How cool is that?!?!?  Thanks so much for the invite guys, we had an absolute blast :)  Sending much love to you from Delos on the high seas.\\n\\nSubscribe at http:\/\/youtube.com\/svdelos\\nThis is our story, a story of three souls sailing around the world.  It is a story about sailing and travel and adventure.  But it's also a story about meeting amazing people and making life long friends.  It's a story of people living their lives in an alternate way, in close connection with the beautiful people and amazing planet that we call home.  Our experience has affected us so profoundly we want to share it, hoping that others may find inspiration to follow their dreams and do what they love.\\nFor more sailing around the World Action! Join the SV Delos Tribe! \\nhttp:\/\/svdelos.com\/camera - Camera gear!\\nhttp:\/\/patreon.com\/svdelos - Support us on Patreon for unseen footage.\\nhttp:\/\/svdelos.com - Subscribe to our new awesome website\\nhttp:\/\/instagram.com\/svdelos - Follow us on Instagram for more behind the scenes footage\\nhttp:\/\/facebook.com\/svdelos - Like us on Facebook \\nhttp:\/\/svdelos.com\/beer - If you like what you see send us a cold one ;)\\nhttp:\/\/svdelos.com\/gear\/ - Support us buy a sweet Delos T-shirt!\\n\\nSend Us Love\\nWe LOVE sailing, we LOVE traveling, and we LOVE making videos about it!  We're only half-way around the world, so there's plenty more to see! Your support will fund better camera gear, internet to upload videos, and of course creative lubricants to smooth the editing process :) \\n\\nSupport Our Videos- Buy us a cold one.\\nhttp:\/\/svdelos.com\/beer\\n\\nThis is made possible by YOU! So thank you so much for all the love and support you guys are sending us! It means a lot! Much Love, Karin, Brian and Brady\\n\\nTunes used in this vid\\n19:00 Ramukanji by Onetox (https:\/\/soundcloud.com\/sailing-sv-delos\/onetox-ramukanji-2011-official-remix)\\n02:20 Thingamajig by Audionautix (http:\/\/audionautix.com)\\n03:31 Live Recordings by Kiko (https:\/\/soundcloud.com\/sailing-sv-delos\/sets\/covers-by-kiko)\\n06:24 This time by GYVUS (http:\/\/chillhop.com\/listen) (https:\/\/soundcloud.com\/gyvus)\\n15:00 SoulGroove by Audionautix (http:\/\/audionautix.com)\\n17:06 Happy Hours by L'IndÇcis (http:\/\/chillhop.com\/listen)\\n22:40 Live Recordings by Kiko (https:\/\/soundcloud.com\/sailing-sv-delos\/sets\/covers-by-kiko)\\n24:55 Eunoia by Andrew Rothschild (https:\/\/andrewrothschild.bandcamp.com\/)\\n26:42 Tōzen by GYVUS (http:\/\/chillhop.com\/listen) (https:\/\/soundcloud.com\/gyvus)\\n30:52 How About It by Topher Mohr and Alex Elena (Youtube Audio Library)\"},\"lengthSeconds\":\"2003\",\"ownerProfileUrl\":\"http:\/\/www.youtube.com\/user\/briantrautman\",\"externalChannelId\":\"UCvLc83k5o11EIF1lEo0VmuQ\",\"isFamilySafe\":true,\"availableCountries\":[\"AD\",\"AE\",\"AF\",\"AG\",\"AI\",\"AL\",\"AM\",\"AO\",\"AQ\",\"AR\",\"AS\",\"AT\",\"AU\",\"AW\",\"AX\",\"AZ\",\"BA\",\"BB\",\"BD\",\"BE\",\"BF\",\"BG\",\"BH\",\"BI\",\"BJ\",\"BL\",\"BM\",\"BN\",\"BO\",\"BQ\",\"BR\",\"BS\",\"BT\",\"BV\",\"BW\",\"BY\",\"BZ\",\"CA\",\"CC\",\"CD\",\"CF\",\"CG\",\"CH\",\"CI\",\"CK\",\"CL\",\"CM\",\"CN\",\"CO\",\"CR\",\"CU\",\"CV\",\"CW\",\"CX\",\"CY\",\"CZ\",\"DE\",\"DJ\",\"DK\",\"DM\",\"DO\",\"DZ\ in La Rochelle, France!!!  It’s always been a dream of ours to meet the team of people that designed and crafted Delos!  After years of sailing the wild oceans we find ourselves in Cape Town safely at a dock and the awesome team at Amel invite us to France to see where Delos was born.  We learn about the history of “The Captain” (Mr. Amel), tour the factory, gorge ourselves on French cuisine, sail on a NEW AMEL 55, and Capt. Breeyawn shows the Amel team how we guzzle champagne Delos style!  How cool is that?!?!?  Thanks so much for the invite guys, we had an absolute blast :)  Sending much love to you from Delos on the high seas.\n\nSubscribe at "},{"text":"http://youtube.com/svdelos","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgBIhMIjqHG3OOY6gIVQ8MWCh3SOQmgSOzcwtf00Om_Ww==","commandMetadata":{"webCommandMetadata":{"url":"http://youtube.com/svdelos","rootVe":83769}},"urlEndpoint":{"url":"http://youtube.com/svdelos","nofollow":true}}},{"text":"\nThis is our story, a story of three souls sailing around the world.  It is a story about sailing and travel and adventure.  But it's also a story about meeting amazing people and making life long friends.  It's a story of people living their lives in an alternate way, in close connection with the beautiful people and amazing planet that we call home.  Our experience has affected us so profoundly we want to share it, hoping that others may find inspiration to follow their dreams and do what they love.\nFor more sailing around the World Action! Join the SV Delos Tribe! \n"},{"text":"http://svdelos.com/camera","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgBIhMIjqHG3OOY6gIVQ8MWCh3SOQmgSOzcwtf00Om_Ww==","commandMetadata":{"webCommandMetadata":{"url":"/redirect?v=W3-mh0rwrmw\u0026redir_token=4_DqRESIpzN6dGAiuG9-GL1bd_B8MTU5MzAzMDY0MEAxNTkyOTQ0MjQw\u0026event=video_description\u0026q=http%3A%2F%2Fsvdelos.com%2Fcamera","rootVe":83769}},"urlEndpoint":{"url":"/redirect?v=W3-mh0rwrmw\u0026redir_token=4_DqRESIpzN6dGA  we had an absolute blast :)  Sending much love to you from Delos on the high seas.\n\nSubscribe at http://youtube.com/svdelos\nThis is our story, a story of three souls sailing around the world.  It is a story about sailing and travel and adventure.  But it's also a story about meeting amazing people and making life long friends.  It's a story of people living their lives in an alternate way, in close connection with the beautiful people and amazing planet that we call home.  Our experience has affected us so profoundly we want to share it, hoping that others may find inspiration to follow their dreams and do what they love.\nFor more sailing around the World Action! Join the SV Delos Tribe! \nhttp://svdelos.com/camera - Camera gear!\nhttp://patreon.com/svdelos - Support us on Patreon for unseen footage.\nhttp://svdelos.com - Subscribe to our new awesome website\nhttp://instagram.com/svdelos - Follow us on Instagram for more behind the scenes footage\nhttp://facebook.com/svdelos - Like us on Facebook \nhttp://svdelos.com/beer - If you like what you see send us a cold one ;)\nhttp://svdelos.com/gear/ - Support us buy a sweet Delos T-shirt!\n\nSend Us Love\nWe LOVE sailing, we LOVE traveling, and we LOVE making videos about it!  We're only half-way around the world, so there's plenty more to see! Your support will fund better camera gear, internet to upload videos, and of course creative lubricants to smooth the editing process :) \n\nSupport Our Videos- Buy us a cold one.\nhttp://svdelos.com/beer\n\nThis is made possible by YOU! So thank you so much for all the love and support you guys are sending us! It means a lot! Much Love, Karin, Brian and Brady\n\nTunes used in this vid\n19:00 Ramukanji by Onetox (https://soundcloud.com/sailing-sv-delos/onetox-ramukanji-2011-official-remix)\n02:20 Thingamajig by Audionautix (http://audionautix.com)\n03:31 Live Recordings by Kiko (https://soundcloud.com/sailing-sv-delos/sets/covers-by-kiko)\n06:24 This time by GYVUS (http://ch
